import React, { useState } from "react";


function Contact(){ 
return (
<main>
    <h2>For More Information . . . </h2>
    <form className="form-group" id="contact-form" onSubmit={handleSubmit}>
      
        <button className="contact-btn" type="submit">
            Submit
        </button>
    </form>
</main>
);

}



export default Contact;
